import "../styles/EditButtons.css";

import React from "react";

const EditButtons = ({ handleSave, saveLabel, handleDelete, handleCancel,btnRed,btnGreen,btnYellow}) => (
  <div className="Edit-Buttons">
    <div
      tabIndex="0"
      className="Edit-Button"
      style={{ backgroundColor: "#5aac44" }}
      onClick={handleSave}
    >
      {saveLabel}
    </div>

    {handleDelete && (
      <div
        tabIndex="0"
        className="Edit-Button"
        style={{ backgroundColor: "#EA2525", marginLeft: 0 }}
        onClick={handleDelete}
      >
        Delete
      </div>



    )}


    <div tabIndex="0" className="Edit-Button-Cancel" onClick={handleCancel}>
      <ion-icon name="close" />
    </div>

    <div
    tabIndex="0"
    className="Edit-Button"
    style={{ backgroundColor: "red" }}
    onClick={btnRed}
    >
    </div>
    <div
    tabIndex="0"
    className="Edit-Button"
    style={{ backgroundColor: "green" }}
    onClick={btnGreen}
    ></div>
    <div
    tabIndex="0"
    className="Edit-Button"
    style={{ backgroundColor: "yellow" }}
    onClick={btnYellow}
    ></div>
  </div>

);

export default EditButtons;
